export default function slideRight(classe: string) {
  var slider: any = document.getElementById(classe);
  slider.scrollLeft += 500;
  return slider
}

export function slideLeft(classe: string) {
    var slider: any = document.getElementById(classe);
    slider.scrollLeft -= 500;
}
